import { borderRadius } from "@mui/system";
import React from "react";

const Status = (status) => {
    if (status.status == true) {
        return <div style={{ color: '#6eeb94'}}>Approve</div>
    } else {
        return <div style={{ color: '#ff0000'}}>Reject</div>
    }
}

export default Status
